import React from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import Home from "../pages/Home";
import Tour from "../pages/Tour";
import TourDetails from "../pages/TourDetails";
import Login from "../pages/Login";
import Register from "../pages/Register";
import SearchResultList from "../pages/SearchResultList";
import ThankYou from "../pages/ThankYou";
import Profile from "../pages/Profile";
import AddTour from "../admin_pages/AddTour";
import AddCategory from '../admin_pages/AddCategory';
import AddSchedule from '../admin_pages/AddSchedule';
import AddCoach from '../admin_pages/AddCoach';
import AddActivity from '../admin_pages/AddActivity';

const Routers = () => {
  return (
    <Routes>
        <Route path="/" element={<Navigate to="/home" />} />
        <Route path="/home" element={<Home />} />
        <Route path="/tours" element={<Tour />} />
        <Route path="/tours/:id" element={<TourDetails />} />
        <Route path="/login" element={<Login />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/register" element={<Register />} />
        <Route path="/thank-you" element={<ThankYou />} />
        <Route path="/tours/search" element={<SearchResultList />} />
        <Route path="/admin" element={<AddTour />} />
        <Route path="/add-category" element={<AddCategory />} />
        <Route path="/add-schedule" element={<AddSchedule />} />
        <Route path="/add-coach" element={<AddCoach />} />
        <Route path="/add-activity" element={<AddActivity />} />
    </Routes>
  );
};

export default Routers;
